// --- amc.FDb.ind_fflag.Find
// Find row by key. Return NULL if not found.
amc::FFflag* amc::ind_fflag_Find(const algo::strptr& key) {
    u32 index = algo::Smallstr100_Hash(0, key) & (_db.ind_fflag_buckets_n - 1);
    amc::FFflag* *e = &_db.ind_fflag_buckets_elems[index];
    amc::FFflag* ret=NULL;
    do {
        ret       = *e;
        bool done = !ret || (*ret).field == key;
        if (done) break;
        e         = &ret->ind_fflag_next;
    } while (true);
    return ret;
}

// --- amc.FDb.ind_fflag.GetOrCreate
// Find row by key. If not found, create and x-reference a new row with with this key.
amc::FFflag& amc::ind_fflag_GetOrCreate(const algo::strptr& key) {
    amc::FFflag* ret = ind_fflag_Find(key);
    if (!ret) { //  if memory alloc fails, process dies; if insert fails, function returns NULL.
        ret         = &fflag_Alloc();
        (*ret).field = key;
        bool good = fflag_XrefMaybe(*ret);
        if (!good) {
            fflag_RemoveLast(); // delete offending row, any existing xrefs are cleared
            ret = NULL;
        }
    }
    vrfy(ret, tempstr() << "amc.create_error  table:ind_fflag  key:'"<<key<<"'  comment:'bad xref'");
    return *ret;
}

// --- amc.FDb.ind_fflag.InsertMaybe
// Insert row into hash table. Return true if row is reachable through the hash after the function completes.
bool amc::ind_fflag_InsertMaybe(amc::FFflag& row) {
    ind_fflag_Reserve(1);
    bool retval = true; // if already in hash, InsertMaybe returns true
    if (LIKELY(row.ind_fflag_next == (amc::FFflag*)-1)) {// check if in hash already
        u32 index = algo::Smallstr100_Hash(0, row.field) & (_db.ind_fflag_buckets_n - 1);
        amc::FFflag* *prev = &_db.ind_fflag_buckets_elems[index];
        do {
            amc::FFflag* ret = *prev;
            if (!ret) { // exit condition 1: reached the end of the list
                break;
            }
            if ((*ret).field == row.field) { // exit condition 2: found matching key
                retval = false;
                break;
            }
            prev = &ret->ind_fflag_next;
        } while (true);
        if (retval) {
            row.ind_fflag_next = *prev;
            _db.ind_fflag_n++;
            *prev = &row;
        }
    }
    return retval;
}

// --- amc.FDb.ind_fflag.Remove
// Remove reference to element from hash index. If element is not in hash, do nothing
void amc::ind_fflag_Remove(amc::FFflag& row) {
    if (LIKELY(row.ind_fflag_next != (amc::FFflag*)-1)) {// check if in hash already
        u32 index = algo::Smallstr100_Hash(0, row.field) & (_db.ind_fflag_buckets_n - 1);
        amc::FFflag* *prev = &_db.ind_fflag_buckets_elems[index]; // addr of pointer to current element
        while (amc::FFflag *next = *prev) {                          // scan the collision chain for our element
            if (next == &row) {        // found it?
                *prev = next->ind_fflag_next; // unlink (singly linked list)
                _db.ind_fflag_n--;
                row.ind_fflag_next = (amc::FFflag*)-1;// not-in-hash
                break;
            }
            prev = &next->ind_fflag_next;
        }
    }
}

// --- amc.FDb.ind_fflag.Reserve
// Reserve enough room in the hash for N more elements. Return success code.
void amc::ind_fflag_Reserve(int n) {
    u32 old_nbuckets = _db.ind_fflag_buckets_n;
    u32 new_nelems   = _db.ind_fflag_n + n;
    // # of elements has to be roughly equal to the number of buckets
    if (new_nelems > old_nbuckets) {
        int new_nbuckets = i32_Max(algo::BumpToPow2(new_nelems), u32(4));
        u32 old_size = old_nbuckets * sizeof(amc::FFflag*);
        u32 new_size = new_nbuckets * sizeof(amc::FFflag*);
        // allocate new array. we don't use Realloc since copying is not needed and factor of 2 probably
        // means new memory will have to be allocated anyway
        amc::FFflag* *new_buckets = (amc::FFflag**)amc::lpool_AllocMem(new_size);
        if (UNLIKELY(!new_buckets)) {
            FatalErrorExit("amc.out_of_memory  field:amc.FDb.ind_fflag");
        }
        memset(new_buckets, 0, new_size); // clear pointers
        // rehash all entries
        for (int i = 0; i < _db.ind_fflag_buckets_n; i++) {
            amc::FFflag* elem = _db.ind_fflag_buckets_elems[i];
            while (elem) {
                amc::FFflag &row        = *elem;
                amc::FFflag* next       = row.ind_fflag_next;
                u32 index          = algo::Smallstr100_Hash(0, row.field) & (new_nbuckets-1);
                row.ind_fflag_next     = new_buckets[index];
                new_buckets[index] = &row;
                elem               = next;
            }
        }
        // free old array
        amc::lpool_FreeMem(_db.ind_fflag_buckets_elems, old_size);
        _db.ind_fflag_buckets_elems = new_buckets;
        _db.ind_fflag_buckets_n = new_nbuckets;
    }
}

